function place_comp_default_keyboard(){
    var DEFAULT_comp = findCompByName("default keyboard_");
    for(i=1;i<=lowercase_FOLDER.items.length;i++ ){
        if(lowercase_FOLDER.item(i).name == "empty_"){
            continue
            }else{
                DEFAULT_comp.layers.add(lowercase_FOLDER.item(i));
                DEFAULT_comp.layer(1).property("Transform").property("Position").
                    setValue(default_comp_btn_position[DEFAULT_comp.layer(1).name])
            }
    }
    
    DEFAULT_comp.layers.add(findCompByName("button /_"));
    DEFAULT_comp.layer("button /_").property("Transform").property("Position").
        setValue(default_comp_btn_position[DEFAULT_comp.layer("button /_").name])
    DEFAULT_comp.layer("button /_").property("ADBE Transform Group").property("ADBE Opacity").
        expression = 'var numberCheck = comp("index").layer("default keyboard")("ADBE Effect Parade")("Number Symbols")("ADBE Checkbox Control-0001"); if(numberCheck.value==1){100}else{0};'

}
