function place_comp_index(){
    //place default keyboard
    var INDEX_comp = findCompByName("index_");
    INDEX_comp.layers.add(findCompByName("default keyboard_"))
    INDEX_comp.layer(1).property("Transform").property("Position").setValue([960,851.5]);
    INDEX_comp.layer(1).property("ADBE Effect Parade").addProperty("ADBE Checkbox Control").name = "Shift";
    INDEX_comp.layer(1).property("ADBE Effect Parade").addProperty("ADBE Checkbox Control").name = "Number Symbols";
    
    //text field
    INDEX_comp.layers.addShape();
    INDEX_comp.layer(1).name = "Text Field";
    var textField = INDEX_comp.layer("Text Field");
    textField.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Rect");
    textField.property("ADBE Root Vectors Group").property("ADBE Vector Shape - Rect").property("ADBE Vector Rect Size").setValue([2128,244]);
    textField.property("ADBE Root Vectors Group").property("ADBE Vector Shape - Rect").property("ADBE Vector Rect Roundness").setValue(905);
    textField.property("ADBE Root Vectors Group").addProperty("ADBE Vector Graphic - Fill").property("ADBE Vector Fill Color").setValue([1,1,1]);
    textField.property("ADBE Transform Group").property("ADBE Position").setValue([960,249])
    textField.property("ADBE Transform Group").property("ADBE Scale").setValue([74.1,74.1])
    
    //char anchors
    INDEX_comp.layers.addShape();
    INDEX_comp.layer(1).name = "char Anchors";
    var charAnchors = INDEX_comp.layer("char Anchors");
    charAnchors.guideLayer = true;
    charAnchors.property("Transform").property("Position").setValue([0,0]);
    charAnchors.property("Transform").property("Anchor Point").setValue([-10,-10]);
    
    for(i=0;i<abc.length;i++){
        charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse")
            .name = abc[i];
        charAnchors.property("ADBE Root Vectors Group").property(abc[i]).property("ADBE Vector Ellipse Size").setValue([20,20])
    }
    for(i=0;i<symbols.length;i++){
        if(symbols[i]=="underscore"){
            charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse")
                .name = "_";
            charAnchors.property("ADBE Root Vectors Group").property("_").property("ADBE Vector Ellipse Size").setValue([20,20])
        }else{
            charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse")
                .name = symbols[i];
            charAnchors.property("ADBE Root Vectors Group").property(symbols[i]).property("ADBE Vector Ellipse Size").setValue([20,20])
        }
    }
    charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse").name = "begin";
    charAnchors.property("ADBE Root Vectors Group").property("begin").property("ADBE Vector Ellipse Size").setValue([20,20])
    
    charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse").name = "space";
    charAnchors.property("ADBE Root Vectors Group").property("space").property("ADBE Vector Ellipse Size").setValue([20,20])
    
    charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Shape - Ellipse").name = "space 2";
    charAnchors.property("ADBE Root Vectors Group").property("space 2").property("ADBE Vector Ellipse Size").setValue([20,20])
    charAnchors.property("ADBE Root Vectors Group").addProperty("ADBE Vector Graphic - Fill").property("ADBE Vector Fill Color").setValue([0.25882339477539,1,0])
    
    charAnchors.enabled = false;
    //set position to anchors
    for(i=1;i<=charAnchors.property("ADBE Root Vectors Group").numProperties;i++){
        if(charAnchors.property("ADBE Root Vectors Group").property(i).property("ADBE Vector Ellipse Size")){
            var anchor_prop_name = charAnchors.property("ADBE Root Vectors Group").property(i).name;
            charAnchors.property("ADBE Root Vectors Group").property(i).property("ADBE Vector Ellipse Position")
                .setValue(charAnchors_positions[anchor_prop_name]);
        }else continue
    }
}
